$(document).ready(function(){
	$("#year").ionRangeSlider({
		hide_min_max: true,
		prettify_enabled: false,
		min: 1970,
		max: 2021,
		from: 1970,
		to: 2021,
		type: 'double',
		step: 1,
		prefix: "Год ",
		grid: false
	});
	
		$(".filter-box select").chosen({
			disable_search_threshold: 100, 
			allow_single_deselect: true, 
			max_selected_options: 5
		});
	
});


